import Icons from "../Global/Icons"
import Imgs from "../Global/Imgs"
export default function Left(){
  return(
    <div class="esquerda">
      <Stories />
      <Posts />
    </div>
  )
}
function Stories(){
    return(
        <div class="stories">
            <Story />
            <div class="setinha">
              <ion-icon name="chevron-forward-circle"></ion-icon>
            </div>
        </div>
    )
}
function Story(){
    const user = ["9gag", "meowed", "barked", "nathanwpylestrangeplanet", "wawawicomics","respondeai", "filomoderna", "memeriagourmet"]
    const src = []
    for(let i = 0; i < user.length;i++){
        src.push(`assets/img/user[i].svg`)
    }
    return (
        <div class="story">
            {src.map(source => 
                <div class="imagem">
                    <img src={source}/>
                </div>)}
            {user.map(u => 
                <div class="usuario">
                {u}
                </div>)}
        </div>
    )
}
